import React,
       { Component, Fragment }            from 'react';
import { Link }                 from 'react-router-dom';
import Footer                   from './../../components/Footer';
import FormRegister             from './../../components/FormRegister';
import Languages                from './../../components/Languages';
import { getLanguage }          from './../../components/i18n';

import LoadingScreen            from './../../components/LoadingScreen';

import {  isAuthenticated,
          register             } from './../../actions/authAction';

import { compose, withProps, lifecycle } from "recompose";

class Login extends Component {

  constructor( props )
  {

    super();

    let texts = getLanguage('pt-br');

    this.state = {
      loading_page: true
    }

  }

  async componentDidMount(){

    document.title = "Roteirizador | Register"

    let auth_response = await isAuthenticated( 'no_authenticated' );

    this.setState({
      loading_page : false
    });

  }

  renderPage = () => {

    return(
      <div>

        <FormRegister />

        <Footer />

      </div>
    )

  }

  render()
  {

    let { loading_page } = this.state;

    return loading_page
            ? <LoadingScreen />
            : this.renderPage();

  }

}

export default Login;
